import React, {useEffect } from 'react';
import { useRouter, withRouter } from 'next/router'
import {useDispatch, useSelector} from 'react-redux';
import {Row, Col, List, Skeleton } from 'antd';
import {SEARCH_TEAMS_REQUEST} from '../../reducers/team'
const Search = (props) =>{
    const dispatch = useDispatch();
    const {list, isSearched, query } = useSelector(state => state.team);
    useEffect(
        ()=>{
            // let tempQuery = "";
            // if (typeof query === "string") {
            //     query = props.router.query.q
            // }
            dispatch({type:SEARCH_TEAMS_REQUEST, data:{"query": props.router.query.q}});
        }
    ,[props.router.query.q]);

    return(
        <div>
            <Row>
                <Col xs={{ span: 24 }} sm={{ span: 22, offset: 1 }} md={{ span: 18, offset: 3 }}>
                    {query}에 대한 검색 결과입니다.
                </Col>
            </Row>
        </div>
    );
}
export default withRouter(Search);
